from fastapi import FastAPIfrom fastapi.middleware.cors import CORSMiddlewarefrom src.api import cv_rankingapp = FastAPI()app.add_middleware(    CORSMiddleware,    allow_origins=["*"],    allow_credentials=True,    allow_methods=["*"],    allow_headers=["*"],)app.include_router(cv_ranking.router, prefix="/api/v1", tags=["CV Ranking"])